import React from 'react'

function Place() {
  return (
    <>
        <div className='w-96 border-2 shadow-lg h-60 m-8'>
            <div className='relative w-full border-2 h-12'></div>
            <div className='h-36 mx-2 absolute border rounded-full w-36'></div>
            <div className='relative w-full border-2 h-12'></div>
        </div>
    </>
  )
}

export default Place
